                    buf.push(13);
                    buf.extend_from_slice(&amount.to_le_bytes());
                    buf.push(decimals);
                }
                &Self::MintToChecked { amount, decimals } => {
                    buf.push(14);
                    buf.extend_from_slice(&amount.to_le_bytes());
                    buf.push(decimals);
                }
                &Self::BurnChecked { amount, decimals } => {
                    buf.push(15);
                    buf.extend_from_slice(&amount.to_le_bytes());
                    buf.push(decimals);
                }
                &Self::InitializeAccount2 { owner } => {
                    buf.push(16);
                    buf.extend_from_slice(owner.as_ref());
